choices.text:
try {
	if (seed == null) {
		rnd.nextBytes(new byte[1]);
	}
	else {
		InputStream inputStream = seed.getInputStream();
		byte[] seedBytes = FileCopyUtils.copyToByteArray(inputStream);
		rnd.setSeed(seedBytes);
	}
}
catch (Exception ex) {
	throw new BeanCreationException("Could not initialize SecureRandom", ex);
}

if (seed == null) {
	rnd.setSeed(System.currentTimeMillis());
}
else {
	InputStream inputStream = seed.getInputStream();
	rnd.setSeed(FileCopyUtils.copyToByteArray(inputStream));
}

